import link from 'next/link';
import Header from './Header';
export default ({children ,title})=>(
    <div className="mainLayout">
        <Header/>
            <title>{title}</title>

            {children}

        <footer>footer</footer>

    <style>{`
            .mainLayout{
                position:fixed;
                left: 19px;
                bottom: 10px;
                 zIndex: 20;

            }
    `}</style>
    </div>
)
